pragma solidity >=0.4.22 <0.9.0;
import "./Context.sol";
import "./interfaces/IOwnable.sol";

/** @dev Contract module which provides a basic access control mechanism, where there is an account (an owner) that can be granted exclusive access to specific functions.* By default, the owner account will be the one that deploys the contract. This can later be changed with {transferOwnership}. This module is used through inheritance. It will make available the modifier `onlyOwner`, which can be applied to your functions to restrict their use to the owner.*/
abstract contract Ownable is IOwnable, Context {   address private _owner;
                                constructor () {address msgSender = _msgSender(); _owner = msgSender; emit OwnershipTransferred(address(0), msgSender); }  /** @dev Initializes the contract setting the deployer as the initial owner.*/
                                function owner() public override view returns (address) { return _owner;}                                  /** @dev Returns the address of the current owner.*/
                                modifier onlyOwner() {require(_owner == _msgSender(), "Ownable: caller is not the owner"); _; }   /**@dev Throws if called by any account other than the owner.*/
                                function renounceOwnership() public override onlyOwner { emit OwnershipTransferred(_owner, address(0));_owner = address(0);}  /** @dev Leaves the contract without owner. It will not be possible to call `onlyOwner` functions anymore. Can only be called by the current owner. NOTE: Renouncing ownership will leave the contract without an owner, thereby removing any functionality that is only available to the owner.*/
                                function transferOwnership(address newOwner) public override onlyOwner {_transferOwnership(newOwner);}  /** @dev Transfers ownership of the contract to a new account (`newOwner`). Can only be called by the current owner. */
                                function _transferOwnership(address newOwner) internal {require(newOwner != address(0), "Ownable: new owner is the zero address");emit OwnershipTransferred(_owner, newOwner); _owner = newOwner;}  /**@dev Transfers ownership of the contract to a new account (`newOwner`).*/
}
